import uiPreview from "./uiPreview";

export default {
    "ui:title": "Basis",
    "ui:preview": uiPreview,
    "ui:layout": "section",
    "ui:options": {
        "collapsible": true,
        "grid": true,
        "spacing": 2
    },
    "ui:fieldset": [
        "titleImage",
        "content",
    ],
    "titleImage": {
        "ui:dialog": true,
        "ui:xs": 4,
    },
    "content": {
        "ui:xs": 8,
        "ui:spacing": 2,
        "ui:fieldset": [
            "title",
            "description",
            "keywords",
//            "parentId"
        ],
        "title": {
            "ui:title": "Tittel",
        },
        "description": {
            "ui:title": "Beskrivelse",
            "ui:widget": "textarea"
        },
        "keywords": {
            "ui:title": "Stikkord",
            "ui:widget": "tags"
        },
        "parentId": {
            "ui:title": "ParentId",
            "ui:field": "parentId",
            "ui:query": {
                "documentType": "event"
            }
        }
    }
}
